description:
This is the first single off of DJ Revolution&amp;#039;s new album &quot;King of The Decks&quot;

The Track is Featuring KRS-ONE &amp; was Produced by DJ Revolution.

Included in this torrent are the Street, Radio, &amp; Instrumental Versions.

I must say KRS killed this, After his Classic &quot;The Emcee&quot; KRS breaks it down for the mentally inept in his future classic &quot;THE DJ&quot;

Album in Stores: September 16th, 2008!
